import React from 'react';
import LandingPage from './LandingPage';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

 const Main = () => (
   <Switch>
    <Route exact path = "/" component = {LandingPage} />
   </Switch>
 )
export default Main;
